export const lanyardLink =
  "https://api.lanyard.rest/v1/users/433637449307127822";

export async function fetchLanyard() {
  const res = await fetch(lanyardLink);
  if (!res.ok) throw new Error("error with lanyard");
  const json = await res.json;
  return json;
}

fetch(lanyardLink)
  .then((response) => response.json())
  .then((data) => console.log(data));
